import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  function handleNameChange({target}) {
    setName(target.value);
  }

  function handlePhoneChange({target}) {
    setPhone(target.value);
  }

  function handleEmailChange({target}) {
    setEmail(target.value);
  }

  return (
    <>
      <form onSubmit={handleSubmit}>
        <div className="form">
          <label for="name" />
          <input id="name" type="text" value={name} onChange={handleNameChange} />
        </div>
        <div className="form">
          <label for="phone" />
          <input id="phone" type="tel" pattern="[0-9]{3}-[0-9]{3}-[0-9]{4}" value={phone} onChange={handlePhoneChange} />
        </div>
        <div className="form">
          <label for="email" />
          <input id="email" type="email" pattern=".+@example\.com" value={email} onChange={handleEmailChange} />
        </div>
        <div className="form">
          <input type="submit" value="Submit" />
        </div>
      </form>
    </>
  );
};
